import React from 'react';
import { View, StyleSheet } from 'react-native';

const Footer = () => {
    return (
        <View style={styles.footerContainer}>
            <View></View>>
        </View>
    );
}

const styles = StyleSheet.create({
    footerContainer: {
        backgroundColor: "#000",
        padding: '40px',
    }
})

export default Footer;
